import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import FilteredList from './FilteredList'

import { AwesomeButton } from "react-awesome-button";
import "react-awesome-button/dist/styles.css";

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      items: [
      {name: "Apples", color: "Red", price: 1.00},
      {name: "Pears", color: "Green", price: 2.00},
      {name: "Oranges", color: "Orange", price: 3.00}
      ],
      discount: false 
    };
  }


  render() {

    const stocks = [
      {name: "Apple", stockPrice: 100, sector: "tech"},
      {name: "Delta", stockPrice: 35, sector: "airlines"}
    ];


    return (
      <div className="main">
        <FilteredList list  = {stocks} />
        <AwesomeButton onPress={this.discountMe}>Hide/Show Discount</AwesomeButton>
      </div>
    )
  }
}

export default App;
